  const url = 'https://thesimpsonsquoteapi.glitch.me/quotes?count=20'

    const showData= async()=>{
      const response = await fetch(url)
      const data = await response.json()
      console.log(data)
      setUSer(data)
    }
    useEffect( ()=>{
      showData()
    },[])

  const columns = [

    {
      name: 'Personaje',
      selector: row =>row.character,

    },
    {
      name: 'imagen',
      selector: row =><img src={row.image} style={{width:100, height:200}}/>,

    },
    {
      name: 'Frace',
      selector: row =>row.quote,

    },

    {
      name: 'Pocision politica',
      selector: row =>row.characterDirection,

    },

  ];

  return (
    <DataTable
    columns={columns}
    data={user}
    />

  );
};

export default Tablon;
